import Cadastrar from "./Cadastrar"
import {Routes, Route} from 'react-router-dom';
import Home from "./pages/home/Home";

export default () => {
    return(
        <Routes>
            <Route index element={<Home/>} />

            <Route exec path="/cadastrar">
                <Cadastrar></Cadastrar>
            </Route>
        </Routes>
    )
}
